import{_ as p,c as o,a4 as i,o as t}from"./chunks/framework.CyeRpf1z.js";const e="/icon/icon-01.png",c="/icon/icon-02.png",n="/icon/icon-03.png",s="/icon/icon-04.png",r="/icon/icon-05.png",l="/icon/icon-06.png",d="/icon/icon-07.png",h="/icon/icon-08.png",m="/icon/icon-09.png",g="/icon/icon-10.png",u="/icon/icon-11.png",b="/icon/icon-12.png",f="/icon/icon-13.png",_="/icon/icon-14.png",k="/icon/icon-15.png",v="/icon/icon-16.png",y="/icon/icon-17.png",x="/icon/icon-18.png",w="/icon/icon-19.png",q="/icon/icon-20.png",A=JSON.parse('{"title":"提取应用icon图标","description":"","frontmatter":{},"headers":[],"relativePath":"yiov/computer/icon.md","filePath":"yiov/computer/icon.md","lastUpdated":1734431113000}'),z={name:"yiov/computer/icon.md"};function P(I,a,S,C,O,B){return t(),o("div",null,a[0]||(a[0]=[i('<h1 id="提取应用icon图标" tabindex="-1">提取应用icon图标 <a class="header-anchor" href="#提取应用icon图标" aria-label="Permalink to &quot;提取应用icon图标&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">(当前界面文档来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>有些特殊的情形我们需要应用图标</p><ul><li><p><a href="#网页提取">网页提取</a></p></li><li><p><a href="#软件提取">软件提取</a></p></li><li><p><a href="#自制图标">自制图标</a></p></li></ul><h2 id="网页提取" tabindex="-1">网页提取 <a class="header-anchor" href="#网页提取" aria-label="Permalink to &quot;网页提取&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">说明</p><p>仅适用于已在应用商店上架的应用</p></div><hr><h3 id="pc端" tabindex="-1">PC端 <a class="header-anchor" href="#pc端" aria-label="Permalink to &quot;PC端&quot;">​</a></h3><p>在相应官网下载即可，比如：微信</p><p>官网：<a href="https://weixin.qq.com/" target="_blank" rel="noreferrer">https://weixin.qq.com/</a></p><p><img src="'+e+'" alt="" loading="lazy"></p><p>进官网后，鼠标右键-查看网页源代码</p><p><img src="'+c+'" alt="" loading="lazy"></p><p>找图片格式就行，我这里是png，右键保存即可</p><p><img src="'+n+'" alt="" loading="lazy"></p><hr><h3 id="安卓端" tabindex="-1">安卓端 <a class="header-anchor" href="#安卓端" aria-label="Permalink to &quot;安卓端&quot;">​</a></h3><p>我们在应用宝里找即可，比如：微信</p><p>应用宝官网：<a href="https://sj.qq.com/" target="_blank" rel="noreferrer">https://sj.qq.com/</a></p><p>搜想要的应用：微信，长按查看图片，保存即可</p><p><img src="'+s+'" alt="" loading="lazy"></p><hr><h3 id="ios" tabindex="-1">iOS端 <a class="header-anchor" href="#ios" aria-label="Permalink to &quot;iOS端 {#ios}&quot;">​</a></h3><p>由于iOS的特殊性无法直接打开查看，即便使用第三方浏览器可以打开，但是预览效果并不理想</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>方案1：使用安卓机在 <a href="https://viayoo.com/zh-cn/" target="_blank" rel="noreferrer">Via浏览器</a> 中查看源代码</p><p>方案2：电脑网页打开，查看源代码</p></div><p>从 App Store 找到应用复制链接出来，比如：微信</p><p><a href="https://apps.apple.com/cn/app/id414478124" target="_blank" rel="noreferrer">https://apps.apple.com/cn/app/id414478124</a></p><p><img src="'+r+'" alt="" loading="lazy"></p><p>查看源代码，找到 <code>AppIcon</code> 这一段png链接就是</p><p><img src="'+l+`" alt="" loading="lazy"></p><p>默认最小是246px，我们把链接最后 <code>246x0w.png</code> 改成 <code>1068x0w.png</code></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>代码最后有说明max最大1068px</p></div><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark has-diff vp-code" tabindex="0"><code><span class="line diff remove"><span>https://is1-ssl.mzstatic.com/image/thumb/Purple126/v4/e4/bd/99/e4bd99ee-afda-3b81-cf17-5faa2960849e/AppIcon-0-1x_U007emarketing-0-4-0-sRGB-0-85-220.png/246x0w.png</span></span>
<span class="line"><span></span></span>
<span class="line diff add"><span>https://is1-ssl.mzstatic.com/image/thumb/Purple126/v4/e4/bd/99/e4bd99ee-afda-3b81-cf17-5faa2960849e/AppIcon-0-1x_U007emarketing-0-4-0-sRGB-0-85-220.png/1068x0w.png</span></span></code></pre></div><p><img src="`+d+'" alt="" loading="lazy"></p><p>还可以用 HQ ICON 在线获取图标，输入应用名称即可</p><p>官网：<a href="https://icon.yukonga.top/" target="_blank" rel="noreferrer">https://icon.yukonga.top/</a></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>唯一不足是尺寸只有512px</p></div><p><img src="'+h+'" alt="" loading="lazy"></p><p>还可以用快捷指令，效果一样的</p><p><a href="https://www.icloud.com/shortcuts/1e38047c04b74604a7e60f5586a3d906" target="_blank" rel="noreferrer">https://www.icloud.com/shortcuts/1e38047c04b74604a7e60f5586a3d906</a></p><h2 id="软件提取" tabindex="-1">软件提取 <a class="header-anchor" href="#软件提取" aria-label="Permalink to &quot;软件提取&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">说明</p><p>常用于未上架的应用，已上架的也可以，只要有安装包即可</p></div><hr><h3 id="pc端-1" tabindex="-1">PC端 <a class="header-anchor" href="#pc端-1" aria-label="Permalink to &quot;PC端&quot;">​</a></h3><p>我们需要用到工具：IconViewer</p><p>官网：<a href="https://botproductions.com/iconview/download.html" target="_blank" rel="noreferrer">https://botproductions.com/iconview/download.html</a></p><p>现在的电脑一般都是64位，下载第一个后，安装</p><p><img src="'+m+'" alt="" loading="lazy"></p><p>以 IconViewer 本身为例，提取他自己的图标</p><p>对着exe程序 - 鼠标右键 - 属性 - Icons选项卡</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>没有选项卡，说明没有安装成功</p></div><p><img src="'+g+'" alt="" loading="lazy"></p><p>选择png的那个，导出也选择png格式保存即可</p><p><img src="'+u+'" alt="" loading="lazy"></p><hr><h3 id="安卓端-1" tabindex="-1">安卓端 <a class="header-anchor" href="#安卓端-1" aria-label="Permalink to &quot;安卓端&quot;">​</a></h3><p>以 555电影 为例，在官网下载app</p><p>官网：<a href="https://www.555dy.app" target="_blank" rel="noreferrer">https://www.555dy.app</a></p><p><img src="'+b+'" alt="" loading="lazy"></p><p>将下载的apk后缀名改成zip</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>本质上来说，apk也是zip格式的压缩包</p></div><p><img src="'+f+'" alt="" loading="lazy"></p><p>然后解压，图标就在某个文件夹中，一般是在 assets 或者 res 中</p><p><img src="'+_+'" alt="" loading="lazy"></p><p>但是这样找太费事了，我们利用安卓机的特性，打开相册查找</p><p>找到最清晰的那个，将它移出来即可</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>移出来了压缩包和文件夹就可以删了</p></div><p><img src="'+k+'" alt="" loading="lazy"></p><hr><h3 id="ios端" tabindex="-1">iOS端 <a class="header-anchor" href="#ios端" aria-label="Permalink to &quot;iOS端&quot;">​</a></h3><p>这里不建议折腾，<a href="#ios">直接网页提取即可</a>，非要折腾</p><p>先下载安装好 <a href="./../iPhone/sign/esign.html">轻松签</a>，以 iBox 为例</p><p>下载：<a href="https://www.mediafire.com/file/o3x8js5vb2xhrdy/" target="_blank" rel="noreferrer">https://www.mediafire.com/file/o3x8js5vb2xhrdy/</a></p><p><img src="'+v+'" alt="" loading="lazy"></p><p>下载 - 选择刚下载好的ibox</p><p><img src="'+y+'" alt="" loading="lazy"></p><p>长按 - 分享 - 选择轻松签</p><p><img src="'+x+'" alt="" loading="lazy"></p><p>然后导入到轻松签，解压并查看文件</p><p><img src="'+w+'" alt="" loading="lazy"></p><p>进入目录就能看见图标了，点击保存到相册即可</p><p><img src="'+q+'" alt="" loading="lazy"></p><h2 id="自制图标" tabindex="-1">自制图标 <a class="header-anchor" href="#自制图标" aria-label="Permalink to &quot;自制图标&quot;">​</a></h2><p>如果你想替换图标，一键裁剪成应用需要的所有尺寸</p><p>图标工厂：<a href="https://icon.wuruihong.com/" target="_blank" rel="noreferrer">https://icon.wuruihong.com/</a></p>',86)]))}const V=p(z,[["render",P]]);export{A as __pageData,V as default};
